import React, { useState } from 'react';
import { FoodCategories } from "./Foodcategories";
/*import './Foodmenu.css';*/
import './Dropdown.css';
import Select from 'react-select';


const WindowNavbar = () => {
    return(
        <nav className="WindowNavbarItems">
            <ul className={'window-navbar-menu'}>
                {FoodCategories.map((item, index) => {
                    return (
                        <li key={index}>
                            <a className={item.cName} href={item.url}>
                                {item.label}
                            </a>
                        </li>
                    )
                })}
            </ul>
        </nav>
    )
};

const customStyles = {
    menu: (provided, state) => ({
      ...provided,
      width: '100%',
      color: '#FFF',
      background: '#000000',
      padding: 20,
      textalign: 'center'
    }),
  }


const Dropdown = () => {
    return(
        <Select options={FoodCategories} styles={customStyles}/>
    )
};

export {WindowNavbar, Dropdown};
